import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectVehicle() {
  const [vehicleId, setVehicleId] = React.useState('');

  const handleChange = (event) => {
    setVehicleId(event.target.value);
  };

  return (
      <FormControl sx={{ m: 1 }} fullWidth size='small'>
        <InputLabel id="demo-simple-select-label">Select Vehicle</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={vehicleId}
          label="Age"
          onChange={handleChange}
        >
          <MenuItem value={1} selected>Car</MenuItem>
          <MenuItem value={2}>Bike</MenuItem>
          <MenuItem value={3}>Scooter</MenuItem>
        </Select>
      </FormControl>
  );
}
